import './CostItem.css'

function CostItem() {
    return (
        <div className='cost-item'>
            <div>March, 8</div>
            <div className='cost-item__description'>
                <h2>Fridge</h2>
                <div></div>
            </div>
            <div className='cost-item__price'>$5.3(Sum)</div>
        </div>
    );  
}

export default CostItem;
